CREATE TABLE IF NOT EXISTS users (
    id UUID NOT NULL,
    created_at TIMESTAMP,
    modified_at TIMESTAMP,
    version INT NOT NULL,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    email VARCHAR(50),
    gender VARCHAR(50),
    company VARCHAR(50),
    avatar VARCHAR (300),
    job_title VARCHAR(50),
    PRIMARY KEY (id)
);

